DROP Database IF EXISTS mifor16;
CREATE Database mifor16;
USE mifor16;

drop table if exists images;
drop table if exists users;

CREATE TABLE `images` (
  `image_id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(2000) DEFAULT NULL,
  `blob_data` longblob DEFAULT NULL,
  `title` varchar(2000) DEFAULT NULL,
  `description` varchar(4369) DEFAULT NULL,
  `extension` varchar(2000) DEFAULT NULL,
  UNIQUE KEY `images_counter_uindex` (`image_id`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8mb4 COMMENT='table for images';

